Output: {{'answer': 'девяносто'}}
---
Input: {{'problem': 'A wildlife researcher is studying a group of 84 flamingos at a lake. During migration season, 3/4 of the flamingos fly to a different location. If each remaining flamingo needs 2 pounds of food per day, how many pounds of food should the researcher prepare daily for the flamingos that stayed behind?'}}
Output: {{'answer': 'сорок два'}}
---
Input: {{'problem': 'A wildlife researcher studying monarch butterfly migration discovered that a group started with 480 butterflies. During their 3000-mile journey, they lose 4% of their population every 500 miles due to various factors. Additionally, at each 1000-mile checkpoint, 15 new butterflies join the group. How many butterflies will complete the entire migration? Round to the nearest whole number.'}}
Output: {{'answer': 'четыреста семнадцать'}}
---
Input: {{'problem': 'Maria is making cookies. Each batch requires 6 eggs, and she wants to make 3 batches. How many eggs does Maria need in total?'}}
Output: {{'answer': 'achtzehn'}}
---
Input: {{'problem': 'A restaurant is preparing for a large catering event. They need to make a special sauce that requires reducing wine by 75% of its original volume through simmering. The recipe calls for 24 liters of wine to start. If they have 15 identical saucepans, and each saucepan can only be filled to 80% of its 2-liter capacity to prevent boiling over, how many complete batches of sauce can they make at once? Note: Each batch must use the full 24 liters of wine to maintain consistency.'}}
Output: {{'answer': 'eins'}}
---
Input: {{'problem': 'A high school band director wants to arrange her concert band into equal rows. She has 48 students total. If she wants to have 6 students in each row and needs to leave 1/4 of the total rows empty for social distancing, how many complete rows will actually have students seated in them?'}}
Output: {{'answer': 'six'}}
---
Input: {{'problem': 'A music teacher has a collection of 84 sheet music pieces. She wants to arrange them into equal stacks for 6 different grade levels. If 1/4 of the sheets in each stack need new plastic covers at $2 per cover, how much will she spend on new covers?'}}
Output: {{'answer': 'forty-two'}}
---
Input: {{'problem': "During an NBA basketball tournament, a team's shooting statistics show they make 45% of their three-point shots and 60% of their two-point shots. In their last game, they scored 78 points total, and the number of successful three-point shots was exactly half the number of successful two-point shots. How many three-point shots did they successfully make in that game?"}}
Output: {{'answer': '육'}}
---
Input: {{'problem': 'A restaurant needs to prepare a special sauce that requires reducing wine by 75% of its original volume through simmering. The chef starts with 48 liters of wine and wants to add herbs when the reduction reaches 40% of the process. If the wine reduces at a constant rate of 2.5 liters per hour, at what hour mark should the chef add the herbs? Additionally, how many more hours after adding the herbs will it take to complete the entire reduction? Give the total hours needed for the complete process.'}}
Output: {{'answer': 'vierzehn'}}
---
Input: {{'problem': "A basketball team's average points per game dropped from 96 to 84 after their star player was injured. The coach wants to maintain the same total team points by improving the efficiency of the remaining players. If there are 5 active players on the court, and each player currently scores an equal share of points, by what percentage must each remaining player increase their individual scoring to compensate for the star player's absence? Round to the nearest whole number."}}
Output: {{'answer': '14'}}
---
Input: {{'problem': 'A community orchestra has 84 musicians. During a renovation of the concert hall, only 3/4 of the musicians can fit on the temporary stage. If each row on the temporary stage can seat 12 musicians, how many complete rows will be needed to seat all the performing musicians?'}}
Output: {{'answer': 'six'}}
---
Input: {{'problem': 'An astronaut packed 15 freeze-dried meals for the space station and already ate 6 of them. How many meals does the astronaut have left?'}}
Output: {{'answer': 'تسعة'}}
---
Input: {{'problem': "A basketball team's shooting accuracy is currently 48%. Their coach wants to improve the team's overall accuracy to 52% by having their star player practice extra shots. If the team takes an average of 80 shots per game, and the star player currently takes 25% of all shots with a 50% accuracy rate, what accuracy percentage must the star player achieve in their shots to help the team reach their 52% goal? Assume other players' accuracy remains constant at 47%. Round your answer to the nearest whole number."}}
Output: {{'answer': '육십칠'}}
---
