Output: {{'answer': 'تسعة عشر'}}
---
Input: {{'problem': 'A family of rabbits has 7 baby bunnies in one burrow and 5 baby bunnies in another burrow. How many baby bunnies are there in total?'}}
Output: {{'answer': 'двенадцать'}}
---
